import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import "./App.css";
import Referee from "../Referee/Referee";

function App() {
  return (
    <Router>
      <div id="app">
        <Routes>
          <Route path="/referee" element={<Referee />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
